import React from 'react';

const SKILLS = [
  { name: 'React', file: '/assets/skills/react.svg' },
  { name: 'HTML5', file: '/assets/skills/html5.png' },
  { name: 'CSS3', file: '/assets/skills/css3.svg' },
  { name: 'JavaScript', file: '/assets/skills/javascript.png' },
  { name: 'Bootstrap', file: '/assets/skills/bootstrap.svg' },
  { name: 'Tailwind', file: '/assets/skills/tailwind.svg' },
  { name: 'GitHub', file: '/assets/skills/github.svg' },
  { name: 'Figma', file: '/assets/skills/figma.png' },
];

export default function Skills() {
  return (
    <section id="skills" className="skills-modern-section container card">
      <h2 className="skills-modern-title">My Skills</h2>
      <p className="skills-modern-subtitle">Technologies I work with</p>
      <div className="skills-modern-grid">
        {SKILLS.map(skill => (
          <div className="skills-modern-item" key={skill.name}>
            <div className="skills-modern-logo">
              <img
                src={skill.file}
                alt={skill.name}
                loading="lazy"
              />
            </div>
            <span className="skills-modern-name">{skill.name}</span>
          </div>
        ))}
      </div>
    </section>
  );
}
